"214997":{"id":"214997","name":"Dra. Cha","slug":"dra-cha","original_title":"닥터 차정숙","overview":"Conta a história de uma graduada em medicina que se tornou dona de casa, mas decidiu retornar à área médica, e do marido médico que mantém uma vida dupla perfeita. Ele é ótimo em seu trabalho e também é ótimo em trair sua esposa.","first_air_date":"2023-04-15","episode_run_time":60,"vote_average":8.1,"number_of_seasons":1,"number_of_episodes":16,"created_by":["Kim Dae-jin","정여랑"],"production_companies":["Next Entertainment World","SLL","Studio & New"],"genres":["Drama","Comédia"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/Asd9Mi9pC2B5UQp2pLplzhbd0bB.jpg","poster_path":"https://image.tmdb.org/t/p/original/wDuDQzCqal1m6EWqXSHnSWksRxP.jpg","cast":["엄정화","김병철","명세빈","Min Woo-hyuk","송지호"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/eB8FZXwhHBT0DjZCveKn3FkpDVk.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/eB8FZXwhHBT0DjZCveKn3FkpDVk.jpg","air_date":"2023-04-15","episode_count":16,"overview":"Vinte anos depois de abandonar a carreira na saúde, uma dona de casa luta para encontrar seu lugar no ambiente cheio de surpresas na residência médica.","vote_average":9,"episodes":{"1":{"name":"Episódio 1","overview":"Cha Jeong-suk testemunha um incidente assustador e congela em meio ao caos. Mais tarde, ela recebe um diagnóstico assustador — colocando Seo In-ho em uma espiral.","air_date":"2023-04-15","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/ctEWnAG5kVkPpTLu56Wy6gheUyT.jpg","vote_average":9},"2":{"name":"Episódio 2","overview":"De volta da beira da morte, Jeong-suk decide viver a vida de forma diferente — reivindicando sua independência fazendo um movimento ambicioso na carreira.","air_date":"2023-04-16","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/tvp8HoXds51u6uUWZXO9vSqNn14.jpg","vote_average":9},"3":{"name":"Episódio 3","overview":"A admissão de Jeong-suk deixa In-ho e Choi Seung-hi abalados. Jeong-suk tenta se adaptar à nova função, mas enfrenta oposição de todos os lados.","air_date":"2023-04-22","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/2vdzXySI4FrurMGiWjsnUQvVF5d.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Após uma noite badalada, Jeong-suk se aproxima de Roy Kim e irrita In-ho. No hospital, ela continua tendo que lidar com o caos.","air_date":"2023-04-23","runtime":64,"still_path":"https://image.tmdb.org/t/p/original/es5h1FeE1xAwyT4tswVteh9uDH3.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Surgem boatos sobre a relação entre Jeong-suk e In-ho. Com as exigências de Seung-hi, Jeong-suk se pergunta se realmente é a pessoa certa para fazer esse trabalho.","air_date":"2023-04-29","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/dHrcP8XRGCfXcHIHwX5GUzUQoCR.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Apesar de receber elogios por seu trabalho, Jeong-suk recebe uma chuva de desprezo. Roy questiona o comportamento de In-ho e depois faz amizade com Jeong-suk.","air_date":"2023-04-30","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/4k6fOZNWDMYDMXph1eD4KYoX9fQ.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Jeong-suk bate de frente com In-ho. Depois, ela encontra provas do relacionamento do filho. Seung-hi confronta Roy sobre a recente descoberta feita por ele.","air_date":"2023-05-06","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/d1PKvtkn53encaioostF9p5LtJW.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"In-ho entra em pânico ao ter o segredo descoberto. Em meio a pedidos conflitantes, Roy precisa tomar uma decisão difícil. Jeong-suk começa a ligar os pontos.","air_date":"2023-05-07","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/c63yrpILk5XaPYcEymVGRiQoz07.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"Após finalmente descobrir o segredo de In-ho, Jeong-suk age de modo estranho. Depois que a mãe de In-ho lhe faz uma visita, Seung-hi enfrenta um problema de saúde.","air_date":"2023-05-13","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/dF3hW67MCGBs4QDen4tzOTGmHfu.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Uma revelação pública deixa Jeong-suk numa situação difícil. Seung-hi confronta In-ho sobre o futuro. Jeon So-ra dá o apoio de que Jeong-suk tanto precisa.","air_date":"2023-05-14","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/qqMejjyKcEqjf7AupmykwVZtxBQ.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"Jeong-suk chega ao limite e se encontra com Seung-hi e In-ho. Roy e In-ho enfrentam suas complicadas emoções.","air_date":"2023-05-20","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/8r4oIAx1N4kopwN3eI4rIgfbgXY.jpg","vote_average":0},"12":{"name":"Episódio 12","overview":"Seung-hi se impõe e enfrenta In-ho. Seo Jung-min entra em crise depois de uma tragédia. Jeong-suk toma uma decisão importante.","air_date":"2023-05-21","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/5LmxjwBY9E3q1pS81lMw6EuQDbs.jpg","vote_average":0},"13":{"name":"Episódio 13","overview":"Jeong-suk tenta seguir com a vida após tomar sua decisão, mesmo com a insistência de In-ho. Roy tenta descobrir a verdade sobre sua família.","air_date":"2023-05-27","runtime":61,"still_path":"https://image.tmdb.org/t/p/original/3UHiNJafi8KeOmJ6Shu4gW8KVKi.jpg","vote_average":0},"14":{"name":"Episódio 14","overview":"Após descobrir a verdade, a mãe de Jeong-suk lida com problemas de saúde. Seung-hi tenta de tudo para achar um tratamento. In-ho não aceita a decisão de Jeong-suk.","air_date":"2023-05-28","runtime":63,"still_path":"https://image.tmdb.org/t/p/original/nAU6d1bbmjedQim925T30sbe8gL.jpg","vote_average":0},"15":{"name":"Episódio 15","overview":"Jeong-suk recebe notícias que podem afetar sua carreira. A mãe de In-ho entra em pânico por conta de uma situação alarmante, colocando a filha em uma situação difícil.","air_date":"2023-06-03","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/4lnTazrdQr81Lp2Du8oTXTCNf3f.jpg","vote_average":0},"16":{"name":"Episódio 16","overview":"Rodeada de pessoas preocupadas, Jeong-suk finaliza os assuntos pendentes antes do procedimento e se prepara para o futuro.","air_date":"2023-06-04","runtime":62,"still_path":"https://image.tmdb.org/t/p/original/uhHcZEMSH0Tw46S6FM6KqsX21ZN.jpg","vote_average":0}}}}},
