"250670":{"id":"250670","name":"Maxton Hall - O mundo entre nós","slug":"maxton-hall-o-mundo-entre-nos","original_title":"Maxton Hall - Die Welt Zwischen Uns","overview":"Quando Ruby presencia uma cena chocante em Maxton Hall (uma escola particular), o arrogante milionário James Beaufort se vê obrigado a fazer um acordo com a bolsista inteligente. O intuito dele é silenciar Ruby, mas a troca de farpas entre eles acaba acendendo uma faísca.","first_air_date":"2024-05-09","episode_run_time":0,"vote_average":8.4,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Mona Kasten"],"production_companies":["UFA Fiction"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/hWT0aaKZN5qF1WECiI4fwluiqbQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/1zZYpO2CH0WmoIfldwPuAWKbB4F.jpg","cast":["Damian Hardung","Harriet Herbig-Matten","Sonja Weißer","Fedja van Huêt","Ben Felipe"],"trailer":"vXBCdxtMxbg","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/1zZYpO2CH0WmoIfldwPuAWKbB4F.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/1zZYpO2CH0WmoIfldwPuAWKbB4F.jpg","air_date":"2024-05-09","episode_count":6,"overview":"N/A","vote_average":8,"episodes":{"1":{"name":"Despercebida","overview":"Quando a bolsista reservada, Ruby Bell, presencia uma cena chocante, ela se encontra na mira do milionário arrogante e privilegiado James Beaufort. A garota está trabalhando no sonho de sua vida enquanto estuda na escola de elite Maxton Hall: entrar na Universidade de Oxford. Mas o plano perfeito de Ruby é jogado no lixo quando James entra em cena.","air_date":"2024-05-09","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/cbxIxWXp6KDW9U2II6afrCvdisQ.jpg","vote_average":7.9},"2":{"name":"Noblesse Oblige","overview":"Depois do desastre da festa, Ruby vai fazer de tudo para que a arrecadação de fundos seja perfeita. No entanto, será um desafio já que James agora fará parte do comitê e terá suas ideias aprovadas por todos. Após uma discussão acalorada entre James e Ruby, a garota deve admitir que passou dos limites.","air_date":"2024-05-09","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/37OI3H6BMHbNCKJAbxDopITJHut.jpg","vote_average":7.8},"3":{"name":"Expostos","overview":"Ruby e James ficam mais próximos enquanto escolhem as roupas do pôster em um arquivo dos Beauforts em Londres, mas um encontro surpresa com os pais de James faz Ruby voltar à realidade e perceber que ela não pertence àquele mundo. Quando o pôster vira o assunto principal na escola, a garota decide dizer para James que quer cortar o contato com ele. Para James, no entanto, isso não é mais opção.","air_date":"2024-05-09","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/oXV6lKEDjlDvIzdK0naZxtRNVhD.jpg","vote_average":10},"4":{"name":"A Hora da Verdade","overview":"Depois de uma festa na casa de Cyril, nada será como antes. Os boatos estão se espalhando e os sentimentos de Ruby por James estão aumentando. James está sendo pressionado por Mortimer e se vê preso entre os dois mundos, mas quando o dia da apresentação da “Beaufort Jovem” cai no mesmo dia do baile de arrecadação de fundos, James precisa tomar uma decisão.","air_date":"2024-05-09","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/xIBhYt1VecY0Qq0dyVlMcrRn4nM.jpg","vote_average":10},"5":{"name":"No Olho do Furacão","overview":"Quanto mais alto, maior a queda. A arrecadação de fundos é um grande sucesso, a carta de recomendação está garantida e Ruby e James, finalmente, estão juntos, mas Mortimer encontra os dois no pior momento possível. A discussão na casa Beaufort termina com uma ameaça perigosa de Mortimer: o futuro de Ruby está em risco. Para proteger Ruby, James deve fazer algo terrível.","air_date":"2024-05-09","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/lzApzjfALwbRwUeLyXhfSw5Rxfr.jpg","vote_average":7.3},"6":{"name":"Um Pouco de Felicidade","overview":"O momento mais esperado chegou: as entrevistas em Oxford estão prestes a começar e o sonho de Ruby está a um passo de acontecer. Ela estaria muito confortável... se não fosse por seu colega de quarto, James. Uma distração que ela não precisaria ter naquele momento. Os dois tentam se evitar, mas não demora muito para que a tensão entre eles aumente drasticamente.","air_date":"2024-05-09","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/vTkFSOnpNag9g0V5gxaHE0BLfzU.jpg","vote_average":5}}}}},
